CREATE TABLE `articulo` (
  `cod` int(10) NOT NULL,
  `codrelev` varchar(15) NOT NULL COMMENT 'Codigo del artÌculo en formato string. Concatenacion de Prefix y SubCod: MDX0001-01',
  `prefix` varchar(3) NOT NULL COMMENT 'Prefijo asignado al Relevador que carga el \r\n\r\nartÌculo',
  `cubcod1` int(4) NOT NULL,
  `subcod2` int(2) NOT NULL,
  `item` int(2) NOT NULL,
  `descripcion` varchar(200) NOT NULL,
  `codtipoprod` int(10) NOT NULL COMMENT 'FK',
  `observaciones` varchar(200) DEFAULT NULL COMMENT 'Texto Libre',
  `packaging` varchar(200) DEFAULT NULL COMMENT 'Texto Libre',
  `colores` varchar(200) DEFAULT NULL COMMENT 'Texto Libre',
  `uxb` int(10) NOT NULL COMMENT 'Unidades por bulto',
  `codunidadpeso` int(10) NOT NULL COMMENT 'FK Unidades de Medida',
  `peso` double NOT NULL COMMENT 'Peso del Articulo',
  `cbm` double DEFAULT NULL COMMENT 'Cubicaje',
  `codtipoembalaje` int(10) NOT NULL COMMENT 'FK Tipos de Embalaje',
  `codmonedavalor` int(10) NOT NULL COMMENT 'FK Monedas',
  `valor` double NOT NULL COMMENT 'Valor del Articulo relevado',
  `codlocal` int(10) NOT NULL COMMENT 'FK Locales',
  `codproveedor` varchar(200) DEFAULT NULL COMMENT 'Texto Libre',
  `codciudad` int(10) NOT NULL COMMENT 'FK Ciudades',
  `codviaje` int(10) NOT NULL COMMENT 'FK Viajes',
  `prodterminado` int(1) NOT NULL COMMENT 'Yes/No',
  `bolsaindividual` int(1) NOT NULL COMMENT 'Yes/No',
  `codposicioncontainer` int(10) NOT NULL,
  `costorepacking` double NOT NULL,
  `preciomercaderia` double NOT NULL,
  `preciofinal` double NOT NULL,
  `aviosvalor` double NOT NULL,
  `codunidadcantminima` int(11) NOT NULL COMMENT 'FK Unidades de Medida p/ Cant \r\n\r\nMinima',
  `cantminima` double NOT NULL COMMENT 'Canti Minima que se puede comprar',
  `codrelevador` int(10) NOT NULL COMMENT 'FK Relevador del Articulo',
  `imgfolder` varchar(200) DEFAULT NULL COMMENT 'Path Carpeta de la Foto',
  `imgpicture` varchar(200) DEFAULT NULL COMMENT 'Path archivo de Foto',
  `fecha_alta` date DEFAULT NULL,
  `fecha_mod` date DEFAULT NULL,
  `usr_alta` date DEFAULT NULL,
  `usr_mod` date DEFAULT NULL,
  PRIMARY KEY (`cod`)
);

CREATE TABLE `viaje` (
  `cod` int(10) NOT NULL,
  `descripcion` varchar(200) NOT NULL,
  `fecha_desde` date NOT NULL,
  `fecha_hasta` date NOT NULL,
  `colorbg` varchar(200) DEFAULT NULL,
  `colorfg` varchar(200) DEFAULT NULL,
  `fecha_alta` date DEFAULT NULL,
  `fecha_mod` date DEFAULT NULL,
  `usr_alta` date DEFAULT NULL,
  `usr_mod` date DEFAULT NULL,
  PRIMARY KEY (`cod`)
);

